<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Become a $Richi</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      margin: 0;
      padding: 0;
      background-color: #000000;
      color: white;
    }
    #header {
      text-align: center;
      padding: 20px 0;
    }
    #header img {
      width: 100%;
      max-width: 1920px; /* Limiting the width to 1920 pixels */
      height: auto; /* Maintain aspect ratio */
    }
    #container-wrapper {
      display: flex;
      flex-direction: column;
      align-items: center;
    }
    #canvas-container {
      width: 300px;
      height: 300px;
      margin: 20px auto;
      position: relative;
      border: 1px solid rgb(255, 255, 255);
      overflow: hidden;
    }
    #canvas {
      width: 100%;
      height: 100%;
      background-color: #2e173e; /* Dark purple color fill */
    }
    #hat {
      width: 150px;
      height: 150px;
      position: absolute;
      pointer-events: auto;
      cursor: move;
      transform-origin: center;
    }
    .buttons-container {
      text-align: center;
      width: 300px;
      margin: 0 auto;
    }
    .button, .slider {
      display: block;
      margin: 10px auto;
      width: calc(100% - 20px);
      background-color: #2e173e;
      color: white;
      border: none;
      padding: 10px;
      border-radius: 5px;
      cursor: pointer;
    }
    .slider::-webkit-slider-thumb {
      background-color: red;
    }
  </style>
</head>

    </div>
    <div class="buttons-container">
      <button id="upload-button" class="button">UPLOAD YOUR PICTURE</button>
      <button id="add-hat-button" class="button">ADD HAT</button>
      <input id="scale-slider" class="slider" type="range" min="0.1" max="10" step="0.1" value="1">
      <input id="rotate-slider" class="slider" type="range" min="0" max="360" step="1" value="0">
      <button id="reset-button" class="button">RESET</button>
      <button id="download-button" class="button">GET YOUR RICHIE</button>
    </div>
  </div>

  <script>
    const canvas = document.getElementById('canvas');
    const ctx = canvas.getContext('2d');
    const hatImg = document.getElementById('hat');
    const addHatButton = document.getElementById('add-hat-button');
    const scaleSlider = document.getElementById('scale-slider');
    const rotateSlider = document.getElementById('rotate-slider');
    const resetButton = document.getElementById('reset-button');
    const downloadButton = document.getElementById('download-button');
    let uploadedImg;
    let oim;
    let isHatAdded = false;
    let hatScale = 1;
    let hatRotation = 0;
    let hatPosition = { x: 0, y: 0 };

    // Function to handle image upload
    document.getElementById('upload-button').addEventListener('click', () => {
      const input = document.createElement('input');
      input.type = 'file';
      input.accept = 'image/*';
      input.onchange = (event) => {
        const file = event.target.files[0];
        if (file) {
          const reader = new FileReader();
          reader.onload = (e) => {
            uploadedImg = new Image();
            uploadedImg.onload = () => {
              // Create a square image of size 1080x1080
              oim = document.createElement('canvas');
              const oimCtx = oim.getContext('2d');
              oim.width = 1080;
              oim.height = 1080;
              oimCtx.drawImage(uploadedImg, 0, 0, 1080, 1080);

              // Draw the oim image onto the website canvas
              canvas.width = uploadedImg.width;
              canvas.height = uploadedImg.height;
              ctx.drawImage(oim, 0, 0, canvas.width, canvas.height);
              
              addHatButton.style.display = 'block';
              scaleSlider.style.display = 'block';
              rotateSlider.style.display = 'block';
              resetButton.style.display = 'block';
              downloadButton.style.display = 'block';
            };
            uploadedImg.crossOrigin = 'anonymous';
            uploadedImg.src = e.target.result;
          };
          reader.readAsDataURL(file);
        }
      };
      input.click();
    });

    // Function to handle adding hat
    addHatButton.addEventListener('click', () => {
      if (!isHatAdded && uploadedImg) {
        hatImg.style.display = 'block';
        hatImg.style.top = '150px';
        hatImg.style.left = '150px';
        hatImg.style.transform = `translate(-50%, -50%) scale(${hatScale}) rotate(${hatRotation}deg)`;
        hatPosition = { x: 150, y: 150 };
        isHatAdded = true;

        // Add event listener for moving the hat
        hatImg.addEventListener('mousedown', startMove);
      }
    });

    // Function to handle scaling with slider
    scaleSlider.addEventListener('input', (event) => {
      hatScale = event.target.value;
      updateHatTransform();
    });

    // Function to handle rotation with slider
    rotateSlider.addEventListener('input', (event) => {
      hatRotation = event.target.value;
      updateHatTransform();
    });

    // Function to update hat transform
    function updateHatTransform() {
      hatImg.style.transform = `translate(-50%, -50%) scale(${hatScale}) rotate(${hatRotation}deg)`;
    }

    // Function to handle hat movement
    function startMove(event) {
      event.preventDefault();
      const initialX = event.clientX;
      const initialY = event.clientY;
      const hatRect = hatImg.getBoundingClientRect();
      const offsetX = initialX - (hatRect.left + hatRect.width / 2);
      const offsetY = initialY - (hatRect.top + hatRect.height / 2);
      const canvasRect = canvas.getBoundingClientRect();

      function moveHat(event) {
        const x = event.clientX - offsetX - canvasRect.left;
        const y = event.clientY - offsetY - canvasRect.top;

        // Ensure the hat's center stays within the canvas boundaries
        const minX = 0;
        const minY = 0;
        const maxX = canvas.width - hatRect.width;
        const maxY = canvas.height - hatRect.height;
        const newLeft = Math.max(minX, Math.min(x, maxX));
        const newTop = Math.max(minY, Math.min(y, maxY));

        hatImg.style.left = `${newLeft}px`;
        hatImg.style.top = `${newTop}px`;
        hatPosition = { x: newLeft, y: newTop };
      }

      function stopMove() {
        document.removeEventListener('mousemove', moveHat);
        document.removeEventListener('mouseup', stopMove);
      }

      document.addEventListener('mousemove', moveHat);
      document.addEventListener('mouseup', stopMove);
    }

    // Function to handle reset
    resetButton.addEventListener('click', () => {
      hatImg.style.display = 'none';
      addHatButton.style.display = 'block';
      scaleSlider.style.display = 'block';
      rotateSlider.style.display = 'block';
      resetButton.style.display = 'block';
      downloadButton.style.display = 'none';
      uploadedImg = null;
      isHatAdded = false;
      hatScale = 1;
      hatRotation = 0;
      hatPosition = { x: 0, y: 0 };
      scaleSlider.value = 1;
      rotateSlider.value = 0;
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      // Fill the canvas with dark purple color
      ctx.fillStyle = '#2e173e';
      ctx.fillRect(0, 0, canvas.width, canvas.height);
    });

    // Function to handle downloading the picture
    downloadButton.addEventListener('click', () => {
      const containerRect = document.getElementById('canvas-container').getBoundingClientRect();
      const sc = 1080 / containerRect.width;

      console.log("Container canvas position:", containerRect);
      console.log("Container canvas center:", { x: containerRect.width / 2, y: containerRect.height / 2 });
      console.log("oim dimensions:", { width: oim.width, height: oim.height });

      // Create a temporary canvas to draw the transformed hat and the scaled image
      const tempCanvas = document.createElement('canvas');
      const tempCtx = tempCanvas.getContext('2d');
      tempCanvas.width = 1080;
      tempCanvas.height = 1080;

      // Draw the uploaded image onto the temporary canvas
      tempCtx.drawImage(oim, 0, 0, 1080, 1080);

      if (isHatAdded) {
        const hatCenterX = hatPosition.x;
        const hatCenterY = hatPosition.y;
        const containerCenterX = containerRect.width / 2;
        const containerCenterY = containerRect.height / 2;

        const pos1 = {
          x: containerCenterX + (hatCenterX - containerCenterX) * sc,
          y: containerCenterY + (hatCenterY - containerCenterY) * sc,
        };

        const v1 = {
          x: pos1.x - containerCenterX,
          y: pos1.y - containerCenterY,
        };

        const hat2Pos = {
          x: 1080 / 2 + v1.x,
          y: 1080 / 2 + v1.y,
        };

        tempCtx.save();
        tempCtx.translate(hat2Pos.x, hat2Pos.y);
        tempCtx.scale(hatScale * sc, hatScale * sc);
        tempCtx.rotate((hatRotation * Math.PI) / 180);
        tempCtx.drawImage(hatImg, -75, -75, 150, 150);
        tempCtx.restore();

        console.log("Original hat size: 150x150");
        console.log("Original hat position:", hatPosition);
        console.log("Input scale:", hatScale);
        console.log("Transformed hat position (pos1):", pos1);
        console.log("Vector v1:", v1);
        console.log("Final hat position (hat2):", hat2Pos);
      }

      // Initiate download with the temporary canvas as the image source
      const downloadLink = document.createElement('a');
      downloadLink.href = tempCanvas.toDataURL('image/png');
      downloadLink.download = 'Your_Richie.png';
      downloadLink.click();
    });
  </script>
</body>
</html>
